const Paragraph = () => {
  return (
    <section className="paragraph" id='paragraph'>
    <div className='text-black' id='Hero2'> 
    <div className='max-w-[800px] mt-[10px] w-full h-full mx-auto text-center flex flex-col justify-center'>
       <h1 className='md:text-lg sm:text-lg text-base font-bold md:py-1'>”In some ways, programming is like painting.”</h1>
       <p className='md:text-2xl text-xl font-bold text-gray-500 md:py-3 py-3'>- Andrew Hunt</p>
        </div>
        </div>
        </section>
  )
}

export default Paragraph;
